import { StyleSheet, Text, View, SafeAreaView} from 'react-native'
import React from 'react'
import HeaderTabs from '../components/HeaderTabs'

const Home = () => {
  return (
    <SafeAreaView>
      {/* <Text>Home</Text> */}
      <HeaderTabs/>
    </SafeAreaView>
  )
}

export default Home

const styles = StyleSheet.create({})
